import './index.css';
import React from "react"
import ReactDOM from 'react-dom';
import App from './App';
import Headings from './Headings'
import { Row } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

ReactDOM.render(
    <Row>
      <Headings/>
      <Row>
        <div><App /></div>
      </Row>
    </Row>,
    document.getElementById('root')
);
